import { Link } from "react-router-dom";

function Login(){
    return(
        <div className="container">
          <div className="row">
            <div className="col-6 offset-3">
             <div className="card">
                <h5 className="card-header">User Login</h5>
                  <div className="card-body">
                       <table></table>
                  </div>
                </div>
             </div>
            </div>
        </div>
    );
}
export default Login;
